databaseChangeLog:
  - changeSet:
      id: 1
      author: boris.osechinskiy
      preConditions:
        - onFail: WARN
        - not:
            - tableExists:
                tableName: user_avatar
      comment: Создание таблицы пользовательских аватаров
      changes:
        - createTable:
            tableName: user_avatar
            columns:
              - column:
                  name: id
                  type: int
                  autoIncrement: true
                  constraints:
                    primaryKey: true
              - column:
                  name: user_id
                  type: int
                  constraints:
                    nullable: false
              - column:
                  name: avatar
                  type: blob
                  constraints:
                    nullable: true
        - addForeignKeyConstraint:
            constraintName: fk_user_avatar_user
            baseTableName: user_avatar
            baseColumnNames: user_id
            referencedTableName: users
            referencedColumnNames: id
      rollback:
        - dropTable:
            tableName: user_avatar

